import React, { useState } from 'react';
import './DashboardLayout.css';

const DashboardLayout = ({ 
  children, 
  activeSection, 
  setActiveSection, 
  isLightTheme, 
  setIsLightTheme,
  adminEmail,
  isMobileMenuOpen,
  setIsMobileMenuOpen 
}) => {
  const [showProfileDropdown, setShowProfileDropdown] = useState(false);

  const handleThemeToggle = () => {
    setIsLightTheme(!isLightTheme);
  };

  const navigationItems = [
    { id: 'overview', icon: 'fas fa-home', label: 'Home' },
    { id: 'attendance', icon: 'fas fa-clipboard-check', label: 'Attendance' },
    { id: 'students', icon: 'fas fa-users', label: 'Students' },
    { id: 'reports', icon: 'fas fa-chart-bar', label: 'Reports' },
    { id: 'settings', icon: 'fas fa-cog', label: 'Settings' }
  ];

  return (
    <div className={`dashboard-container ${isLightTheme ? 'light-theme' : ''}`}>
      {/* Top Navigation Header */}
      <div className="dashboard-header">
        <div className="header-left">
          <div className="logo-section">
            <i className="fas fa-cube"></i>
            <span className="brand-name">Dashboard</span>
          </div>
        </div>

        <div className="header-right">
          <div className="header-icons">
            <button className="header-icon-btn" title="Notifications">
              <i className="fas fa-bell"></i>
            </button>
            <button 
              className="header-icon-btn theme-toggle-btn" 
              title={isLightTheme ? "Switch to Dark Theme" : "Switch to Light Theme"}
              onClick={handleThemeToggle}
            >
              <i className={`fas ${isLightTheme ? 'fa-moon' : 'fa-sun'}`}></i>
            </button>
            <div className="admin-profile-section">
              <button 
                className="header-icon-btn admin-profile-btn" 
                title="Admin Profile"
                onClick={() => setShowProfileDropdown(!showProfileDropdown)}
              >
                <i className="fas fa-user-circle" style={{ marginRight: '5px' }}></i>
                <span className="admin-email">{adminEmail}</span>
                <i className={`fas fa-chevron-down dropdown-arrow ${showProfileDropdown ? 'rotated' : ''}`}></i>
              </button>
              {showProfileDropdown && (
                <div className="profile-dropdown">
                  <div className="dropdown-item logout-item" onClick={() => window.location.href = '/html/login.html'}>
                    <i className="fas fa-sign-out-alt"></i>
                    <span>Logout</span>
                  </div>
                </div>
              )}
            </div>
          </div>

          <button 
            className="mobile-menu-toggle"
            onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
          >
            <span className="material-icons">
              {isMobileMenuOpen ? 'close' : 'menu'}
            </span>
          </button>
        </div>
      </div>

      <div className="dashboard-layout">
        {/* Left Sidebar */}
        <div className={`sidebar ${isMobileMenuOpen ? 'sidebar-open' : ''}`}>
          <div className="sidebar-header">
            <h2>Dashboard</h2>
            <p className="welcome-text">Welcome, admin</p>
          </div>
          <nav className="sidebar-nav">
            {navigationItems.map(item => (
              <div 
                key={item.id}
                className={`nav-item ${activeSection === item.id ? 'active' : ''}`}
                onClick={() => setActiveSection(item.id)}
              >
                <i className={item.icon}></i>
                <span>{item.label}</span>
              </div>
            ))}
          </nav>
        </div>

        {/* Main Content Area */}
        <div className="main-content">
          {children}
        </div>
      </div>
    </div>
  );
};

export default DashboardLayout;
